import { View, Text } from 'react-native';

export default class Chat extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    var payments = [];
    for(let i = 0; i < 10; i++){

      payments.push(
        <View key = {i}>
        <Text style={{fontSize:15,color:'black'}}>Hola</Text>
        </View>
      )
    }
    return (
      <View>
        {payments}
      </View>
    );
  }
}
